#코코블리
짧고 굵게
실내복 홈모델을 모집합니다!
스포티한 느낌의 크롭 민소매 티가 기다리고 있어요💙
.
.
⭐️참여방법⭐️
1. 코코블리 @by_cocovely 팔로우
(이미 팔로우 되어 있으신 분들 당연히 참여 가능합니다!)
2. 본 게시물 리그램 또는 캡쳐 후 업로드
3. 사이즈와 함께 자신있는 반려견의 사진을 🌸3장🌸 DM으로 전송! (너무 많이 보내시면 안돼요, 넘으면 삐🙅🏻‍♀️)
4. 댓글로 참여 완료를 알려주세요!
.
비공개 계정 및 이벤트 계정은 참여 불가능합니다
.
참여 기한은 9/7 23:59까지이며, 
선정된 분께는 9/8일 저녁에 DM으로 개별 연락 드리겠습니다🤗
.
.
지난번 모집에는 안내를 못드렸으나 
홈모델로 참여해주신 반려견들에겐 코코블리 적립금 20,000원이 주어질 예정입니다💜
.
홈모델로 선정된 친구들은 상품을 받으신 후 3일 이내에 실내,외에서 촬영된 사진을 보내주셔야 하며, 
사진은 코코블리의 인스타 및 스마트 스토어에서 활용될 수 있음을 미리 알립니다.
.
.
